import React, {useEffect, useContext} from 'react';
import {Context} from "../index";
import {fetchBrands, fetchDevices } from "../http/deviceAPI";


const Basket = () => {
    const {device} = useContext(Context)

    useEffect(() => {
        fetchDevices(device.selectedType.id, device.selectedBrand.id, device.page, 7).then(data => {
            // console.log(data);
            // const gesrg = fawefef(data.rows)
            // console.log(gesrg);

            // .map(dat => console.log(dat))
            // console.log(result1);
            // dat => result.push(dat)
            // console.log(result);
            // console.log(data.rows[1].price);
            device.setDevices(data.rows)
            device.setTotalCount(data.count)
        })
    }, [device.page, device.selectedType, device.selectedBrand,])


    return (
        <div>
            basket
        </div>
    );
};

export default Basket;
